<script>
import NavBar from "../components/NavBar";
import { getData, sendData } from "../tools/network";
import Like from "../components/Like";
import ProjectMin from "../components/ProjectMin";

const testData = {
    name: "MatLePirrate",
    bio: "Developpre en piraterie",
    like: 0,
    creationDate: "12/10/2012",
    color: "blue",
    profilePic: "",
};
export default {
    data() {
        return {
            name: "user",
            bio: "",
            creationDate: 0,
            like: 0,
            color: "",
            profilePic: "",
        };
    },
    components: {
        Like,
        NavBar,
        ProjectMin,
    },
    methods: {
        loadData(data) {
            this.name = data.pseudo;
            this.bio = data.bio;
            this.like = data.like;
            this.color = data.color;
            this.profilePic = data.profilePic;
            this.creationDate = data.creationDate;
        },
        async liked() {
            sendData("/likeUser/" + this.$route.params.id, {});
            this.like = this.like + 1;
        },
    },
    async created() {
        try {
            let data = await getData("/users/" + this.$route.params.id);
            this.loadData(data);
        } catch (error) {
            this.loadData(testData);
        }
    },
};
</script>

